def save_setting():
    content = json.dumps(
        {
            'path': Path,
            'method': down_method,
            'aria_thread': down_thread,
            'aria_start': aria_start_with,
            'idm': idm_path,
            'ListOrder': ListOrder,
            'Reverse': ListReverse,
            'aria_RPC': aria_RPC,
            'temp_path': temp_path,
            'flash_link': flash_link,
            'fl_password': fl_password,
            'fl_token': fl_token,
        }
    )
    NTG_base.write_file('./data/conf.dat', content)
    return True

if os.path.exists('./data/mdc.dat'):
    multi_down_count = int(NTG_base.read_file('./data/mdc.dat'))
else:
    multi_down_count = 0

if os.path.exists('./data/conf.dat'):
    config_inf = NTG_base.read_file('./data/conf.dat')
    try:
        config = json.loads(config_inf)
        Path = config['path']
        down_method = config['method']
        down_thread = config['aria_thread']
        aria_start_with = config['aria_start']
        idm_path = config['idm']
        ListOrder = config['ListOrder']  #time,name,size
        ListReverse = config['Reverse']#True时为正序
        aria_RPC = config['aria_RPC']
        temp_path = config['temp_path']
        flash_link = config['flash_link']
        fl_password = config['fl_password']
        fl_token = config['fl_token']
    except:
        Path = ''
        down_method = 'local_mulit'
        down_thread = 1
        aria_start_with = False
        idm_path = 'C:\Program Files\IDM\IDMan.exe'
        ListOrder = 'time'  #time,name,size
        ListReverse = True#True时为正序
        aria_RPC = 'http://localhost:6800/jsonrpc'
        temp_path = './temp'
        flash_link = ''
        fl_password = ''
        fl_token = ''
        save_setting()
else:
    Path = ''
    down_method = 'local_mulit'
    down_thread = 1
    aria_start_with = False
    idm_path = 'C:\Program Files\IDM\IDMan.exe'
    ListOrder = 'time'  #time,name,size
    ListReverse = True#True时为正序
    aria_RPC = 'http://localhost:6800/jsonrpc'
    temp_path = './temp'
    flash_link = ''
    fl_password = ''
    fl_token = ''
    save_setting()



